import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className="app-wrap">
      <header className="header">
        <img src="https://upload.wikimedia.org/wikipedia/commons/b/be/Lineage_OS_Logo.png" alt="" className="logo" />
      </header>
      <nav className="nav">
        <dl className="sidebar">
          <dt>Profile</dt>
          <dt>Messages</dt>
          <dt>News</dt>
          <dt>Music</dt>
          <dt>Settings</dt>
        </dl>
      </nav>
      <article className="article">
        <img src="https://storge.pic2.me/cm/2560x1440/951/58487259adcd0.jpg" alt="" />
      </article>
    </div>
  );
}


export default App;
